('2372','15','7900','Marcel Silvia Blanco',Null,'Einfamilienhaus in Bunyola zu verkaufen','33385','Bunyola liegt nur 15 Minuten von Palma entfernt auf dem Weg nach Soller und dem Tramuntana Gebirge. \r\nDieses schicke Einfamilienhaus wurde 2005 auf einem 2.000m² großen Grundstück erstellt. Die Wohnfläche von 280m² verteilt sich auf 2 Etagen plus kleinen Kellerraum und bietet Wohn-Esszimmer (mit hoher Decke und Galerie), Küche, 3 Schlafzimmer, 2 Badezimmer und Gäste WC. Ausgestattet mit Doppelglasfenster, isolierten Außenwände und einer Ölzentralheizung, kann das Haus auch ganzjährig bewohnt werden. Im gepflegten Garten hat es noch einen Pool zum relaxen\r\n','33386','990000','106','2015-09-09 11:05:01','106','2015-09-09 11:05:47',Null,'2463','134','1156',1,'1','0',Null,Null,Null,'33387',Null,'0','0','0',Null,'2015-09-09 11:10:44',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33388',Null,'33389',Null,'33390',Null,'33391','628630456','33392','0',0,'0');
